		const muscle_selector = document.getElementById(`muscle_selector`);

		function showOptions() {
			Object.keys(muscle_list).forEach(muscle_id => {
				const muscle_option = document.createElement(`option`);
				muscle_option.value = muscle_id;
				muscle_option.textContent = muscle_list[muscle_id].muscle_name;
				muscle_selector.appendChild(muscle_option);
			});

			muscle_selector.addEventListener(`change`, showMuscles);
			showMuscles();
		}

		function showMuscles() {
			const muscle_id = muscle_selector.value;
			const muscle_selected = muscle_list[muscle_id].muscle_selection || muscle_list["0"].muscle_selection;

			const muscle_elements = document.querySelectorAll(`svg g[id]`);

			muscle_elements.forEach(muscle_element => {
				const element_id = muscle_element.id;

				if (muscle_selected.includes(element_id)) {
					muscle_element.style.display = `unset`;
				} else {
					muscle_element.style.display = `none`;
				}

			});
		}

		window.onload = showOptions;
